import styles from "./Skills.module.css";

function OutputSkills(props){


    return(          
        (
        <div className={styles.output}>
          <p className={styles.p1}>{props.language}</p>
          <p className={styles.p2}>Years of Experience: {props.experience}</p>
          <button onClick={props.setClick}>-</button>
        </div>

      ))

}
export default OutputSkills
